import "./LoginSignup.css";

function LoginPage() {
    return (
        <div className="login-signup-form-container">

            <h2>Login</h2>
            <form>
                <div>
                    <label>Email address</label>
                    <input type="text"/>
                </div>

                <div>
                    <label>Password</label>
                    <input type="text"/>
                </div>

            </form>
        </div>
    );
}

export default LoginPage;
